const tasks = [
    {
      title: "Buy groceries",
      content: "Milk, eggs, bread",
    },
    {
      title: "Call mom",
      content: "Wish her a happy birthday and ask about her day",
    },
    {
      title: "Finish the report",
      content: "Due by Friday, proofread and double-check for errors",
    },
    {
      title: "Plan vacation",
      content: "Research destinations and book flights",
    },
    {
      title: "Go to the gym",
      content: "Cardio and weightlifting",
    },
    // Add more tasks below
    {
      title: "Read a book",
      content: "Choose a book and dedicate an hour to reading",
    },
    {
      title: "Pay bills",
      content: "Utility bills, rent, and credit card payment",
    },
    {
      title: "Write code",
      content: "Work on a coding project for at least 2 hours",
    },
  ];
  
export default tasks;
